import React from 'react';

import './css/style.css';

export default class App extends React.Component {
    render() {
        return <div className="App">
            <nav>
                <h2 class="logo">
                <a class="logo-link" href="#">  Nav bar</a>
                </h2>
                <ul class="nav-menu">
                    <li><a class="nav-menu-link" href="#">Home</a></li>
                    <li><a class="nav-menu-link" href="#">Portfolio</a> </li>
                    <li><a class="nav-menu-link" href="#">Support</a></li>
                </ul>
            </nav>
        </div>
    }
}
